const links = [
  { name: "Home", path: "/" },
  { name: "Doctors", path: "/doctors" },
  { name: "Patients", path: "/patients" },
];

function NavBar() {
  return (
    <ul>
      {links.map((link, index) => (
        <NavLink key={index} to={link.path} exact activeClassName="current">
          <li>{link.name}</li>
        </NavLink>
      ))}
    </ul>
  );
}

export default NavBar;
